('cs', '_template', 'atutor_accessibility_text', '<p>ATutor obsahuje mnoho funkcí navržených pro zlepšení přístupnosti obsahu všem potenciálním uživatelům, včetně těch, kteří mají pomalé připojení k Internetu, staré či atypické prohlížeče, nebo kteří kvůli zdravotním postižením musejí využívat k přístupu na web různé pomůcky. Tyto možnosti jsou dále detailně popsány.</p>', '2004-05-20 11:02:32', ''),
('cs', '_template', 'atutor_handbook', 'Oficiální příručka pro používání ATutora', '2007-11-26 17:14:30', ''),
('cs', '_template', 'atutor_home', 'ATutor domů', '2004-05-21 04:54:46', ''),
('cs', '_template', 'atutor_is', '<strong><em>ATutor</em></strong> je Open Source Web-based <strong>Learning Content Management System (LCMS)</strong> \r\nnavržený zvláště s ohledem na přístupnost a přizpůsobivost. Administrátoři mohou instalovat nebo aktualizovat ATutora během několika minut. Vyučující mohou rychle sestavit, zabalit a redistribuovat výukový obsah a online provozovat své kurzy. Studenti se učí v přizpůsobivém výukovém prostředí.', '2007-12-11 23:19:36', ''),
('cs', '_template', 'atutor_links', '<p>Další informace o <a href=\"http://atutor.ca/index.php\">ATutorovi</a> se dozvíte po návštěvě těchto odkazů:</p> <ul> <li><a href=\"http://www.atutor.ca/howto.php\">ATutor kurz<em>Jak na to</em></a> - Naučíte se používat ATutor prostřednictvím instrukčního kurzu</li> <li><a href=\"http://atutor.ca/atutor/docs/index.php\">FAQ</a> - často kladené otázky a odpovědi</li> <li><a href=\"http://atutor.ca/forums/index.php\">Fórum podopry</a> - Příspěvky od uživatelů</li> <li><a href=\"http://atutor.ca/services/index.php\">Podpůrné služby</a> - potřebujete-li naši pomoc, podpora je k dispozici</li> <li><a href=\"http://atutor.ca/atutor/translate/index.php\">Lokalizace</a> - Stahujte jazykové balíčky, zapojte se do překladu</li> <li><a href=\"http://atutor.ca/services/licensing.php\">Licence</a> - ATutor software je volně k dispozici za určitých podmínek</li> <li><a href=\"http://atutor.ca/atutor/download.php\">Download</a> - všechen software potřebný k rozchození ATutora je možno stáhnout zde</li></ul>', '2007-11-26 17:15:37', ''),
