('cs', '_template', 'chat_help_display_blurb', '<p>Poznámka: <em>Přejít na</em> a <em>Rychlý přístup</em> se zobrazí pouze pokud máte zapnutou  <em>Pomoc při navigaci</em>v nastavení.</p>\r\n\r\n<ul>\r\n<li>Odkaz <em>Přejít na rychlý přístup</em> (nahoře) vás nasměruje na seznam rychlých přístupů pro Pokec.  </li>\r\n<li><em>Zprávy</em> zobrazí nejnovější zprávy (posledních 10). </li>\r\n<li>Kliknutím na<em>Přejít na zprávy</em> se ocitnete na začátku seznamu zpráv (Alt+M) </li>\r\n<li>Kliknutím na<em>Obnovit zprávy</em> zobrazíte nové zprávy (Alt+R). </li>\r\n<li> Pomocí pole <em>Vytvořit novou zprávu</em> a <em>Odeslat</em> můžete vkládat a odesílat zprávy (Alt+C pro vytvoření, Enter pro odeslání). </li>\r\n</ul>', '2007-12-01 11:45:28', ''),
